'''Мордовиянь книгань издательствась''' Покамац Мордовиянь книгань издательствась МОРДКИЗ - государствань предприятия Мордовияса - Россиянь региононь издательстватнень эзда фкя инь оцюсь. Панчфоль 1932 кизонь 19-це апрельста. Эста лемоцоль - ;Мордовиянь государственнай издательствакс, Мордгиз;.
Сон нолясь литература мокшень и эрзянь кяльса. 1963-це кизоста сявомок лемоц арась - Мордкиз.
Коллективсь ноляй школатненди учебникт, художественнай, краень содамань наукань книгат, лия изданият рузонь, мокшень и эрзянь кяльса.
Мордкизонь панжемстонза васенце кизонькиге нолдась 54 лемонь книга. Войнада ингольдень пинть издательствась лама тись респукбликаса кялень норматнень ладямаса.
Мордовиянь писательхне эсь тяштьфсост няфнезь полафткснень, конат мольсть странаса и республикаса. 1940-це кизоня лиссь лама томонь ;Мордовия АССР-ть историянц коряс докуметтне и материалхне ; васенце книгась.
Издательствась нолясь книгат войнань пингтьке.
Мекольдень кизотнень нолдафольхть : ;Мордовскяй народть устно-поэтическяй творчествац;
;Мордовскяй романць; (рузонь кяльса)
;Мордовскяй библиотекась; (мокшень и эрзянь кяльса)
;Мордовиянь ошне и велетне;
;Твой милый образ незабвенный;
;Русская старина;
лиссендихть книгат шачема масторть историянц колга, мокшень и эрзянь кяльса валкст, учебникт. сявф: ;Мордвась; энциклопедиясь, Саранск: 2006 к. - 540 л. 	153	5	0	5	8	"good"
